const Contactus = () => {
  return (
    <ContactUsContent/>
  );
};

export default Contactus;
const Container = styled.div`
  display: flex;
  width: 100%;
  flex-direction: column;
  background-color: ${({ theme }) => theme.colors.white};
`;
